        return (
            <h1>
                <Pet name={individualPets.pets.name} breed={individualPets.pets.breed} />

            </h1>
        )
    })
    return (
        <div>
            {rolladex2}
        </div>
    )
}



function Friend(props) {



    return (

        < div >
            <h1>{props.name}</h1>
            <h2>{props.age}</h2>
            <h2>{props.petByPet()}</h2>
        </div>
    )

}




export default Friend
